import React from 'react';
import 'onsenui/css/onsenui.css';
import 'onsenui/css/onsen-css-components.css';
import TabBar from './Element/TabBar';

var Ons = require('onsenui');
var ROns = require('react-onsenui');

class Main extends React.Component {

    renderPage(route, navigator) {
      const props = route.props || {};
      props.navigator = navigator;
  
      return React.createElement(route.component, props);
    }

    MainPage(){

      console.log(this);

      return(
            Ons.platform.isAndroid() |Ons.platform.isIOS() | true ? <TabBar navigator= {this.props.navigator}/> : null); 
    }
      
    render() {
      return (
        <ROns.Navigator
        initialRoute={{component: this.MainPage.bind(this), props: {key: 'main'}}}
        renderPage={this.renderPage}/> );
    }
}

export default Main;
